DECLARE @DATA TABLE (BF_SSN CHAR(9), LN_SEQ INT)

SELECT DISTINCT
	D.*,
	LN10.LC_STA_LON10, 
	LN10.LA_CUR_PRI, 
	 DW01.LA_NSI_OTS
FROM
	@DATA D 
	INNER JOIN UDW..LN10_LON LN10
		ON LN10.BF_SSN = D.BF_SSN
		AND LN10.LN_SEQ = D.LN_SEQ
	INNER JOIN UDW..DW01_DW_CLC_CLU DW01
		ON DW01.BF_SSN = D.BF_SSN
		AND DW01.LN_SEQ = D.LN_SEQ

